import logo from './logo.svg';
import './App.css';
import Map from './components/map.js';
import StatBar from './components/statusBar.js';

function App() {
  return (
    <body style={{backgroundColor: '#353535ff', overflow: 'hidden'}}>
      <div className="App">
          <div style={{height: '5vh', width: '100%'}}>
            <StatBar />
          </div>
        <Map />
      </div>
    </body>
  );
}

export default App;
